31 oktober, 2010. Vier vrienden uit Los Angeles besluiten huizen in Hollywood te bezoeken waar het volgens de geruchten spookt en waar bekende personen zijn omgebracht. Ze filmen alles en hopen een geest vast te leggen. De vrienden treffen echter weinig interessants aan, totdat ze bij het huis genaamd '1666' aankomen...



